import React from "react";

const Document = (documents) => {
  var docList = documents.map(({ filename, author }) => {
    return (
      <div className="file shadow-sm">
        <h6>{name}</h6>
        <h6>{author}</h6>
      </div>
    );
  });
  return docList;
};

export default Document;
